import { useState } from 'react';
import { Link } from 'react-router-dom';
import { AccountCircle, ArrowBack, ArrowForwardIos, Lock } from '@material-ui/icons';
import { ButtonDefault } from '../../components/buttons/default';
import { ButtonPrimary } from '../../components/buttons/primary';
import './index.scss';
import { QueroConhecer } from './queroConhecer';

const axios = require('axios').default;

export function axiosTest() {
    var options = {
        method: 'POST',
        url: 'http://localhost:8181/Departamentos/index/main',
        headers: {
            'content-type': 'application/json',
            'x-rapidapi-host': 'geekflare.p.rapidapi.com',
        },
        data: { teste: 'Gabriel Ariza' }
    };

    axios.get(options.url).then(function (response: any) {
        console.log(response);
    }).catch(function (error: any) {
        console.error(error);
    });
}

export function arizappJsQueryTest() {
    Z.ajax({
        url: 'http://localhost:8181/Departamentos/index/main',
        with_credentials: true,
        method: 'GET',
        success: function (data) {
            console.log(data);
        }
    });
}
export function fetchTest() {
    try {
        axios.post({
            url: "https://arizapp.com.br:8181/Administracao/root/api/getClientesHost/",
            data: {
                page_to_list: 1,
                search: ''
            },
            beforeSend: function (xhr: any) {
                xhr.setRequestHeader("Connection", "keep-alive");
                xhr.setRequestHeader("sec-ch-ua", "'Not A;Brand';v='99', 'Chromium';v='96', 'Google Chrome';v='96'");
                xhr.setRequestHeader("sec-ch-ua-mobile", "?0");
                xhr.setRequestHeader("User-Agent", "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_15_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4648.0 Safari/537.36");
                xhr.setRequestHeader("sec-ch-ua-platform", "macOS");
                xhr.setRequestHeader("Content-Type", "application/x-www-form-urlencoded");
                xhr.setRequestHeader("Accept", "*/*");
                xhr.setRequestHeader("Origin", "https://arizapp.com.br:8181");
                xhr.setRequestHeader("Sec-Fetch-Site", "same-origin");
                xhr.setRequestHeader("Sec-Fetch-Mode", "cors");
                xhr.setRequestHeader("Sec-Fetch-Dest", "empty");
                xhr.setRequestHeader("Referer", "https://arizapp.com.br:8181/Administracao/root/listarClientesHost?pagina=1&search=");
                xhr.setRequestHeader("Accept-Language", "pt-BR,pt;q=0.9,en-US;q=0.8,en;q=0.7");
                xhr.setRequestHeader("Cookie", "arizapp_token_client_host_login=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..a48S-7iIxBLrX-VJ8h3x2QJLjT_WQTJ5AzOirSos4Mc");
            }
        });

    } catch (e) {
        console.log(e);
        return;
    }
    return;
}

export function LoginPage() {



    const [asideContent, setAsideContentState] = useState('default');
    const setAsideContentOnClick = function (content: string) {
        setAsideContentState(content);
        return;
    }
    const AsideDefaultContent = function (): JSX.Element {
        return (
            <>
                <h1>Arizapp</h1>
                <ButtonDefault onClick={(ev) => { return setAsideContentOnClick('queroConhecer'); }}>Quero conhecer</ButtonDefault>
            </>
        );
    }

    return (
        <main>
            <aside>
                {(asideContent === 'queroConhecer' ? <QueroConhecer /> : <AsideDefaultContent />)}
                <button onClick={event => { axiosTest() }}>AXIOS TESTE</button>
                <button onClick={event => { arizappJsQueryTest() }}>ARIZAPPJSQUERY TESTE</button>
                <button onClick={event => { fetchTest() }}>FETCH TESTE</button>
            </aside>
            <div className="content">
                <div className="content-indicate arrow">
                    <ArrowForwardIos sx={{ fontSize: '60px' }} />
                    <span>Login</span>
                </div>
                <div className="content-container">
                    <div className="formContent">
                        <form>
                            <div className="formContent-area formContent-header">
                                <h1>Entrar</h1>
                            </div>
                            <div className="formContent-area formContent-body">
                                <div className="input-group inline">
                                    <span><AccountCircle sx={{ fontSize: '2.0em' }} /></span>
                                    <input type="text" className="form-control" name="username" placeholder="Username" />
                                </div>
                                <div className="input-group inline">
                                    <span><Lock sx={{ fontSize: '2.0em' }} /></span>
                                    <input type="password" className="form-control" name="password" placeholder="Password" />
                                </div>
                            </div>
                            <div className="formContent-area formContent-footer">
                                <div className="input-group inline">
                                    <ButtonPrimary className="form-control">Entrar</ButtonPrimary>
                                </div>
                                <Link to="/cadastro">Criar conta</Link>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </main>
    );
}
